script: |
  super -f text -I q6506.spq | sort > q6506.out

inputs:
  - name: q6506.spq
    data: |
      SELECT ALL - col2, - col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col2 IN ( - - 92 * + col0 + - + ( col1 ) + 86 * - col2 * + + col1, - col2 + col0 );
  - name: tab2

outputs:
  - name: q6506.out
    data: |
      -40	-40
      -58	-58
